import React from 'react'
import DeleteSongButton from './deleteSongButton'
import { useSongs, useGigInfo } from './util/hooks'

const Songs = () => {
  const { songs } = useSongs()

  if (songs) {
    if (songs.length > 0) {
      return (
        <div>
        <p>no songs</p>
        </div>
      )
    }
  } else {
    console.log(songs)
    return (
      <div>
      <p>there are songs</p>
      </div>
    )
  }
}

export default Songs
